    public function getSourceContext()
    {
        return new Source("{% extends 'base.html.twig' %}

{% block title 'Espace administration' %}

{% block main %}

    <div class=\"container mt-4\">
        <div class=\"row justify-content-center\">
            <div class=\"col-md-7\">
                <h2>Espace administration</h2>
                <hr>
            
                {% if error %}
                    <div class=\"alert alert-danger\">
                        {{ error.messageKey | trans(error.messagedata, 'security') }}
                    </div>
                {% endif %}

                <form action=\"{{ path('login') }}\" method=\"post\">
                    <div class=\"form-group\">
                        <label for=\"username\">Nom d'utilisateur</label>
                        <input type=\"text\" id=\"username\" name=\"_username\" class=\"form-control\" value=\"{{ last_username }}\">
                    </div>
                    <div class=\"form-group\">
                        <label for=\"password\">Mot de passe</label>
                        <input type=\"password\" id=\"password\" name=\"_password\" class=\"form-control\">
                    </div>
                    <a href=\"{{ path('admin.property.index') }}\"><button type=\"submit\" class=\"btn btn-primary\">Se connecter</button></a>
                </form>   
            </div>        
        </div>
    </div>

{% endblock %}

{% block footer %}{% endblock %}

", "security/login.html.twig", "/Applications/MAMP/htdocs/AgenceImmo/templates/security/login.html.twig");
